gnetizma, pa je deloval tudi na mnogih drugih. Teslina znamenita izuma sta tudi Teslovo navitje (Teslov transformator) in turbina brez lopatic. Njegov sistem izmeničnega toka je omogočil lažji in učinkovitejši prenos električne energije na daljavo. Po njegovih načrtih so izdelali prvo hidroelektrarno na Niagarskih slapovih.','Tesla > Edison');
